import Order from './Order'

const PrevOrders = ({orders, items}) => {

    return (
        <div>
            <h2>Previous Orders</h2>
            {orders.filter(order => order.complete === true).map(order =>
                <Order key={order.id} order={order} item={items.order.id}/>
            )}
        </div>
    )
}

export default PrevOrders
